	render() {
		state = {
			currency: "USD"
		};
		return (
			<div>
				<ul className="list-group">
					<li className="list-group-item">
						Prices Bitcoin Rate For {}:
						{/* <span className="badge badge-primary"></span>{" "}
						<strong>{this.props.data.bpi.USD.description}</strong> */}
					</li>
				</ul>
			</div>
		);
	}
}

export default Prices;
